//                                                 //
//  BASE CLASSES                                   //
/////////////////////////////////////////////////////

class XClass {
   args: any[];
   constructor (...args: any[]) {
      this.args = args;
   }
   clone (): this {
      // @ts-expect-error
      return new this.constructor(...XClass.clone(this.args));
   }
   static clone (value: any): any {
      if (value && typeof value === 'object') {
         if (value instanceof XClass) {
            return value.clone();
         } else if (value instanceof Node) {
            return value.cloneNode(true);
         } else if (typeof value[Symbol.iterator] === 'function') {
            if (value instanceof Map) {
               // @ts-expect-error
               return new value.constructor([ ...value.entries() ].map(XClass.clone));
            } else if (value instanceof Set) {
               // @ts-expect-error
               return new value.constructor([ ...value.values() ].map(XClass.clone));
            } else {
               return [ ...value ].map(XClass.clone);
            }
         } else {
            return Object.fromEntries(Object.entries(value).map(XClass.clone));
         }
      } else {
         return value;
      }
   }
}

class XHost<X extends XKeyed<any[]> = {}, Y extends XKeyed<any[]> = X> extends XClass {
   private events = new Map<keyof Y, Set<XListener<Y[keyof Y]>>>();
   constructor (...args: any[]) {
      super(...args);
      this.args = args;
   }
   fire<Z extends keyof Y> (name: Z, ...data: Y[Z]) {
      if (this.events.has(name)) {
         return [ ...this.events.get(name)! ]
            .sort(
               (listener1, listener2) =>
                  (typeof listener1 === 'function' ? 0 : listener1.priority) -
                  (typeof listener2 === 'function' ? 0 : listener2.priority)
            )
            .map(listener => (typeof listener === 'function' ? listener : listener.script)(...data));
      } else {
         return [];
      }
   }
   off<Z extends keyof Y> (name: Z, listener: XListener<Y[Z]>) {
      this.events.has(name) && this.events.get(name)!.delete(listener as XListener<Y[keyof Y]>);
      return this;
   }
   on<Z extends keyof Y> (name: Z, listener: XListener<Y[Z]>, once?: boolean): this {
      if (once) {
         const singleton = (...data: Y[Z]) => {
            this.off(name, singleton);
            return (typeof listener === 'function' ? listener : listener.script).call(this, ...data);
         };
         return this.on(name, singleton);
      } else {
         this.events.has(name) || this.events.set(name, new Set());
         this.events.get(name)!.add(listener as XListener<Y[keyof Y]>);
         return this;
      }
   }
   when<Z extends keyof Y> (name: Z): Promise<void> {
      return new Promise(resolve => this.on(name, (...data) => resolve(...data), true));
   }
   with<Z extends keyof Y> (name: Z, listener: (self: this, ...data: Y[Z]) => any, once?: boolean) {
      return this.on(name, (...data: Y[Z]) => listener(this, ...data), once);
   }
}

class XMap<X, Y> extends Map<X, Y> {
   deleter: (key: X, value: Y) => void;
   setter: (key: X, value: Y) => void;
   constructor (properties: XProperties<XMap<X, Y>, 'deleter' | 'setter'> = {}) {
      super();
      this.deleter = properties.deleter || (() => {});
      this.setter = properties.setter || (() => {});
   }
   delete (key: X) {
      this.has(key) && this.deleter(key, this.get(key)!);
      return super.delete(key);
   }
   set (key: X, value: Y) {
      value === this.get(key) || (this.deleter(key, this.get(key)!), this.setter(key, value));
      return super.set(key, value);
   }
}

class XSet<X> extends Set<X> {
   adder: (value: X) => void;
   deleter: (value: X) => void;
   constructor (properties: XProperties<XSet<X>, 'adder' | 'deleter'> = {}) {
      super();
      this.adder = properties.adder || (() => {});
      this.deleter = properties.deleter || (() => {});
   }
   add (value: X) {
      this.has(value) || this.adder(value);
      return super.add(value);
   }
   delete (value: X) {
      this.has(value) && this.deleter(value);
      return super.delete(value);
   }
}

