class XPerishable<X extends { death: []; tick: [] } = any> extends XEntity<X> {
   lifespan: number;
   constructor (properties: ConstructorParameters<typeof XEntity>[0] & XProperties<XPerishable, 'lifespan'> = {}) {
      super(properties);
      this.lifespan = properties.lifespan || 0;
   }
   tick () {
      if (this.state.lifetime < this.lifespan) {
         super.tick();
      } else if (this.state.lifetime++ === this.lifespan) {
         this.fire('death');
      }
   }
}

class XWalker<X extends { tick: []; trigger: [XEntity] } = any> extends XEntity<X> {
   sprites: Partial<XKeyed<XSprite, XDirection>>;
   stride: number;
   constructor (
      properties: ConstructorParameters<typeof XEntity>[0] & XProperties<XWalker, 'sprites' | 'stride'> = {}
   ) {
      super(properties);
      this.sprites = properties.sprites || {};
      this.stride = typeof properties.stride === 'number' ? properties.stride : 1;
   }
   walk (offset: XPosition, frisk: boolean, ...entities: XEntity[]) {
      const origin = Object.assign({}, this.position);
      const endpoint = { x: this.position.x + offset.x * this.stride, y: this.position.y + offset.y * this.stride };
      const collidables = entities.filter(entity => entity.attributes.collide);
      for (const axis of [ 'x', 'y' ] as ('x' | 'y')[]) {
         this.position[axis] = endpoint[axis];
         const collisions = X.intersection(X.bounds(this), ...collidables);
         if (collisions.size > 0) {
            let check = true;
            const stride = endpoint[axis] - origin[axis];
            const step = stride / Math.abs(stride);
            this.position[axis] = origin[axis];
            while (check && this.position[axis] !== endpoint[axis]) {
               this.position[axis] += step;
               if (X.intersection(X.bounds(this), ...collisions).size > 0) {
                  this.position[axis] -= step;
                  check = false;
               }
            }
            frisk && axis === 'y' && this.position[axis] === origin[axis] && (this.position[axis] -= stride / 2);
         }
      }
      for (const entity of X.intersection(
         X.bounds(this),
         ...[ ...entities ].filter(entity => entity.attributes.trigger)
      )) {
         entity.fire('trigger', entity);
         this.fire('trigger', entity);
      }
      if (this.position.x !== origin.x || this.position.y !== origin.y) {
         if (this.position.y > origin.y) {
            this.sprite = this.sprites.up || this.sprite;
         } else if (this.position.y < origin.y) {
            this.sprite = this.sprites.down || this.sprite;
         } else if (this.position.x < origin.x) {
            this.sprite = this.sprites.left || this.sprite;
         } else if (this.position.x > origin.x) {
            this.sprite = this.sprites.right || this.sprite;
         }
         this.sprite && this.sprite.enable();
         return true;
      } else {
         if (offset.y > 0) {
            this.sprite = this.sprites.up || this.sprite;
         } else if (offset.y < 0) {
            this.sprite = this.sprites.down || this.sprite;
         } else if (offset.x < 0) {
            this.sprite = this.sprites.left || this.sprite;
         } else if (offset.x > 0) {
            this.sprite = this.sprites.right || this.sprite;
         }
         this.sprite && this.sprite.disable();
         return false;
      }
   }
}

