//                                                 //
//  BASE CLASSES                                   //
/////////////////////////////////////////////////////

class UndertaleGame<X extends { tick: [] } = any> extends XHost<X> {
   atlas: XAtlas;
   data: UndertaleSave;
   default: UndertaleSave;
   dialoguer: XDialoguer;
   items: Map<string, UndertaleItem>;
   key: string;
   overworld: XOverworld;
   player: XWalker | null;
   rooms: XKeyed<XRoom>;
   state = { debug: false, frisk: true, interact: false };
   get room () {
      return this.rooms[this.data.room];
   }
   get stat () {
      return Object.assign(Undertale.data.stat(this.data), {
         atx: this.items.get(this.data.weapon)!.value,
         dfx: this.items.get(this.data.armor)!.value
      });
   }
   constructor (
      properties: XProperties<UndertaleGame, 'items' | 'key' | 'player'> &
         XProperties<{
            framerate: number;
            inputs: XKeyed<XKey, 'down' | 'interact' | 'left' | 'menu' | 'right' | 'special' | 'up'>;
            key: string;
            menu: string | null;
            player: XWalker;
            size: XPosition;
            wrapper: Element;
         }> &
         Partial<{
            items: XKeyed<UndertaleItem>;
            navigators: XKeyed<XNavigator>;
            sprites: XKeyed<XSprite>;
            voices: XKeyed<XSound | XVoice>;
            rooms: XKeyed<
               XProperties<
                  { bounds: XBounds; entities: XEntity[]; walls: XOptional<XBounds>[] } & XKeyed<
                     (ConstructorParameters<typeof XRendered>[0] & { object: XDrawn })[],
                     'backgrounds' | 'overlays'
                  > &
                     XKeyed<
                        XProperties<{ bounds: XBounds; listener: XListener; metadata: XKeyed<XBasic> }>[],
                        'interacts' | 'triggers'
                     >
               > & {
                  doors: XKeyed<
                     XProperties<{ bounds: XBounds; default: boolean; direction: XDirection; distance: number }> &
                        XKeyed<string, 'destination' | 'door'>
                  >;
               }
            > | void;
         }> & { default: UndertaleSave }
   ) {
      super(properties);
      const {
         inputs: {
            down = new XKey('s', 'S', 'ArrowDown'),
            interact = new XKey('z', 'Z', 'Enter'),
            left = new XKey('a', 'A', 'ArrowLeft'),
            menu: menu1 = new XKey('c', 'C', 'Control'),
            right = new XKey('d', 'D', 'ArrowRight'),
            special = new XKey('x', 'X', 'Shift'),
            up = new XKey('w', 'W', 'ArrowUp')
         } = {},
         size: { x = 320, y = 240 } = {}
      } = properties;
      this.atlas = new XAtlas({
         menu: typeof properties.menu === 'string' ? properties.menu : null,
         navigators: properties.navigators || {}
      });
      this.default = properties.default;
      this.dialoguer = new XDialoguer({ sprites: properties.sprites || {}, voices: properties.voices || {} });
      this.items = new Map(Object.entries(properties.items || {}));
      this.key = properties.key || '';
      this.data = Undertale.data.load(this.key) || properties.default;
      this.overworld = new XOverworld({
         renderers: {
            background: new XRenderer(),
            foreground: new XRenderer({ attributes: { animated: true } }),
            overlay: new XRenderer(),
            menu: new XRenderer({ attributes: { animated: true, static: true } })
         },
         size: { x, y },
         wrapper: properties.wrapper
      });
      this.player = (properties.player || new XWalker())
         .on('trigger', ({ metadata: { undertale, key, destination } }) => {
            undertale === 'door-to' && destination in this.rooms && this.teleport(destination, key);
         });
      this.rooms = Object.fromEntries(
         Object.entries(
            properties.rooms || {}
         ).map(
            (
               [
                  key,
                  {
                     backgrounds = [],
                     bounds: { h = 0, w = 0, x = 0, y = 0 } = {},
                     doors = {},
                     entities = [],
                     interacts = [],
                     overlays = [],
                     triggers = [],
                     walls = []
                  }
               ]
            ) => [
               key,
               new XRoom({
                  bounds: { h, w, x, y },
                  entities: [
                     ...[ ...backgrounds ].map(
                        ({ alpha, parallax, position, rotation, scale, object }) =>
                           new XEntity({
                              alpha,
                              parallax,
                              position,
                              renderer: 'background',
                              rotation,
                              scale,
                              sprite: new XSprite({ objects: [ object ] })
                           })
                     ),
                     ...Object.entries(doors)
                        .map(
                           (
                              [
                                 key,
                                 {
                                    bounds: { h = 0, w = 0, x = 0, y = 0 } = {},
                                    default: $default,
                                    destination,
                                    direction = 'down',
                                    distance = 0
                                 }
                              ]
                           ) => [
                              new XEntity({
                                 attributes: { trigger: true },
                                 bounds: { h, w },
                                 metadata: { destination, key, undertale: 'door-to' },
                                 position: { x, y }
                              }),
                              new XEntity({
                                 metadata: { default: $default, direction, key, undertale: 'door-from' },
                                 position: {
                                    x: { down: x + w / 2, left: x - distance, right: x + w + distance, up: x + w / 2 }[
                                       direction
                                    ],
                                    y: { down: y - distance, left: y + h / 2, right: y + h / 2, up: y + h + distance }[
                                       direction
                                    ]
                                 }
                              })
                           ]
                        )
                        .flat(),
                     ...[ ...interacts ].map(({ bounds: { h, w, x, y } = {}, listener = () => {}, metadata = {} }) =>
                        new XEntity({
                           attributes: { interact: true },
                           bounds: { h, w },
                           metadata,
                           position: { x, y }
                        }).on('interact', listener)
                     ),
                     ...[ ...overlays ].map(
                        ({ alpha, parallax, position, rotation, scale, object }) =>
                           new XEntity({
                              alpha,
                              parallax,
                              position,
                              renderer: 'overlay',
                              rotation,
                              scale,
                              sprite: new XSprite({ objects: [ object ] })
                           })
                     ),
                     ...[ ...triggers ].map(({ bounds: { h, w, x, y } = {}, listener = () => {}, metadata = {} }) =>
                        new XEntity({
                           attributes: { trigger: true },
                           bounds: { h, w },
                           metadata,
                           position: { x, y }
                        }).on('trigger', listener)
                     ),
                     ...[ ...walls ].map(
                        ({ h = 0, w = 0, x = 0, y = 0 } = {}) =>
                           new XEntity({ attributes: { collide: true }, bounds: { h, w }, position: { x, y } })
                     ),
                     ...entities
                  ]
               })
            ]
         )
      );
      down.on('down', () => this.atlas.move({ y: 1 }));
      interact.on('down', () => {
         if (this.atlas.state.navigator) {
            this.atlas.navigate('next');
         } else if (!this.state.interact && this.player) {
            for (const entity of X.intersection(
               X.bounds(this.player),
               ...[ ...this.room.entities, ...this.overworld.entities ].filter(entity => entity.attributes.interact)
            )) {
               this.player.fire('interact', entity);
               entity.fire('interact', entity);
            }
         }
      });
      left.on('down', () => this.atlas.move({ x: -1 }));
      menu1.on('down', () => this.state.interact || this.atlas.navigate('menu'));
      right.on('down', () => this.atlas.move({ x: 1 }));
      special.on('down', () => this.atlas.navigate('prev'));
      up.on('down', () => this.atlas.move({ y: -1 }));
      X.ready(async () => {
         this.overworld.wrapper.style.opacity = '0';
         const interval = setInterval(() => {
            try {
               this.atlas.tick();
               this.overworld.refresh() && this.render();
               if (this.player) {
                  if (!this.atlas.state.navigator && !this.state.interact) {
                     if (
                        this.player.walk(
                           { x: left.active ? -1 : right.active ? 1 : 0, y: up.active ? 1 : down.active ? -1 : 0 },
                           this.state.frisk && up.active && down.active,
                           ...this.room.entities,
                           ...this.overworld.entities
                        )
                     ) {
                        this.render();
                     }
                  } else {
                     this.player.sprite && this.player.sprite.disable();
                  }
               }
               this.render(true);
               if (this.state.debug) {
                  const color = new Date().getMilliseconds() / 1000 * 360;
                  const layer = this.overworld.renderers.get('foreground')!;
                  for (const entity of [ ...this.room.entities, ...this.overworld.entities, this.player ]) {
                     if (entity) {
                        const bounds = X.bounds(entity);
                        layer.context.lineWidth = 0.5;
                        layer.context.strokeStyle = `hsla(${color}, 100%, 50%, 1)`;
                        layer.context.strokeRect(bounds.x, bounds.y * -1 - bounds.h, bounds.w, bounds.h);
                        layer.context.closePath();
                     }
                  }
               }
               this.fire('tick');
            } catch (error) {
               console.log(error);
               if (this.state.debug) {
                  clearInterval(interval);
                  debugger;
               }
            }
         }, 1e3 / (typeof properties.framerate === 'number' ? properties.framerate : 30));
         this.teleport(this.data.room);
      });
   }
   activate (index: number, action: 'use' | 'info' | 'drop') {
      const name = this.data.items[index];
      if (name in this.items) {
         const item = this.items.get(name)!;
         switch (action) {
            case 'drop':
               this.data.items.splice(index, 1);
               break;
            case 'use':
               switch (item.type) {
                  case 'armor':
                  case 'weapon':
                     if (this.data[item.type]) {
                        this.data.items[index] = this.data[item.type];
                        this.data[item.type] = name;
                     } else {
                        this.data[item.type] = this.data.items.splice(index, 1)[0];
                     }
                     break;
                  case 'consumable':
                     this.data.items.splice(index, 1);
                     this.data.hp = Math.min(this.data.hp + item.value, Undertale.data.stat(this.data).hp);
                     item.script && item.script(this);
                     item.sfx && item.sfx.play();
                     break;
               }
               break;
         }
         return item.text[action];
      }
   }
   damage (amount: number) {
      this.data.hp -= Math.round(
         amount + Math.floor(X.clamp(this.data.hp, 10, 90) - 10) / 10 - (this.stat.df + this.stat.dfx) / 5
      );
   }
   async dialogue (...lines: string[]) {
      if (this.dialoguer.mode === 'read') {
         this.dialoguer.skip();
         await this.dialoguer.when('idle');
         this.dialogue(...lines);
      } else {
         this.dialoguer.mode = 'none';
         this.dialoguer.lines = [];
         this.dialoguer.add(...lines);
         await this.dialoguer.when('stop');
      }
   }
   load () {
      this.data = Undertale.data.load(this.key) || this.default;
   }
   render (animated = false) {
      const player = this.player;
      player && this.overworld.entities.add(player);
      this.overworld.render(this.room, this.player ? X.center(this.player) : { x: 0, y: 0 }, animated);
      player && this.overworld.entities.delete(player);
   }
   reset () {
      Undertale.data.reset(this.key);
   }
   save () {
      Undertale.data.save(this.key, this.data);
   }
   async teleport (room: string, door?: string | void) {
      if (room in this.rooms) {
         let opacity = +(this.overworld.wrapper.style.opacity as string);
         const interact = this.state.interact;
         interact || (this.state.interact = true);
         while (opacity > 0) {
            opacity -= 0.01 * (1 / 0.3);
            await X.pause(10);
            this.overworld.wrapper.style.opacity = `${X.clamp(opacity, 0, 1)}`;
         }
         await X.pause(150);
         this.data.room = this.data.room = room;
         if (this.player) {
            for (const { metadata: { default: $default, direction, key, undertale }, position: { x, y } } of this.room
               .entities) {
               if (undertale === 'door-from' && (door ? key === door : $default)) {
                  this.player.position = { x: x - this.player.bounds.w / 2, y: y - this.player.bounds.h / 2 };
                  this.player.sprite = this.player.sprites[direction as XDirection] || this.player.sprite;
                  this.player.sprite && this.player.sprite.disable();
                  break;
               }
            }
         }
         this.render();
         while (opacity < 1) {
            opacity += 0.01 * (1 / 0.3);
            await X.pause(10);
            this.overworld.wrapper.style.opacity = `${X.clamp(opacity, 0, 1)}`;
         }
         interact || (this.state.interact = false);
      }
   }
}
